#!/usr/bin/python3

def isSubsequence(s, t):
    size = len(t)
    small_size = len(s)
    index1 = 0
    index2 = 0
    if small_size > size:
        return False
    if small_size == size:
        return s == t
    while index1 < size:
        if t[index1] == s[index2]:
            index2 += 1
            if index2 == small_size:
                return True
        index1 += 1
    return False





if __name__ == '__main__':
    s = "abc"
    t = "ahbgdc"
    #s = "axcx"
    #t = "axxxxxcccc"
    print(isSubsequence(s, t))
